import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

function DeleteProd() {
  let { id } = useParams();
  useEffect(() => {
    axios.get(`http://localhost:3001/DeleteProd/deleteId/${id}`);
  });
  return <div></div>;
}

export default DeleteProd;
